import * as React from "react";
import { ReactSketchCanvas } from "react-sketch-canvas";

const styles = {
  border: "0.0625rem solid #9c9c9c",
  borderRadius: "0.25rem",
};

const App = () => {
  return (
    <ReactSketchCanvas
      id={"rsc"}
      style={styles}
      width={"500px"}
      height={"500px"}
      strokeWidth={15}
      eraserWidth={15}
      strokeColor={"blue"}
      canvasColor={"white"}
    />
  );
};

export default App;
